import React from "react";

export default function about() {
  return (
    <div className="flex text-[white] flex-col my-10 max-w-[1100px] mx-auto">
      <div className=" float-left flex">
        <h1 className="font-[bold] text-[20px] ">
          <span id="span">1.</span>
          About Me
        </h1>


      </div>

      <div className=" p-1 my-10 float-left flex">
        <div className="float-left flex">

        <h1 className="font-thin text-[20px] flex align-baseline ">Hello, I'm ShivRaj Singh, and I enjoy creating things that live on the internet. My primary focus and specialization lie in <span id="span">ReactJS</span>. With a strong background in <span id="span">JavaScript</span>, I am adept at crafting dynamic and interactive web interfaces.</h1>
        </div>
      </div>
    </div>
  );
}
